import React from 'react';
import {
    IonToolbar,
    IonTitle,
    IonButtons,
    IonMenuButton,
} from '@ionic/react';
import { Menu } from './menu';

export const Header: React.FC = () => {
    return (
        <IonToolbar>
            <IonButtons slot="start">
                <Menu />
            <IonMenuButton />
            </IonButtons>
            <IonTitle>
                Ionic Pizza
            </IonTitle>
        </IonToolbar>
    );
}
